import React, { Component } from 'react';
import Liste from './component/lister'

 class List extends Component {
  render() {
    return (
      <div className="contact">
        <h1>Liste</h1>
         {/* Link to Lister.js */}
      <Link to={'./testliste'}>
        <button variant="raised">
            My List
        </button>
      </Link>

      <Router>
      <div className="App">
        <header className="App-header">
            <ul className="liste">
              <li><Link to="/testliste">test</Link></li>
            </ul>

            <Route path="/testliste" component={Liste} />
        </header>
      </div>
      </Router>
      </div>
    )
  }
}

export default List;
